import  selectUser  from "./Action";

const initialState ={
    selectedUser : ""
}
debugger;
const SelectUserReducer =(state = initialState,action) =>{
    debugger;
    switch(action){
        case selectUser:
        return{
            ...state,
        }
        default: return state;
    }
}

export default SelectUserReducer;
